import PortfolioList from "../portfolioList/PortfolioList";
import "./portfolio.scss"
<link href="https://fonts.googleapis.com/css2?family=Hurricane&display=swap" rel="stylesheet"></link>
export default function Portfolio() {
  const list = [
    {
      id: "featured",
      title: "Featured",
    },
    {
      id: "web",
      title: "Web App",
    },
    {
      id: "mobile",
      title: "Mobile App",
    },
    {
      id: "design",
      title: "Design",
    },
    {
      id: "content",
      title: "Content",
    },
  ];

  return (
    <div className="Portfolio" id="portfolio">
      <h1> Products </h1>
      <ul>
       {list.map(item => (
         <PortfolioList title = {item.title}/>
       ))}

      </ul>
      <div className="container">
        <div className="item">
          <img src="assets/earing.jpg"/>
          <h3> Earings </h3>
        </div>

        <div className="item">
          <img src="assets/keychain.jpg"/>
          <h3> keychain </h3>
        </div>

        <div className="item">
          <img src="assets/bc.jpg"/>
          <h3> Buisness Cards </h3>
        </div>

        <div className="item">
          <img src="assets/gift3.jpg"/>
          <h3> Plaques </h3>
        </div>

        <div className="item">
          <img src="assets/gift.jpg"/>
          <h3> Gifts </h3>
        </div>




      </div>


    </div>
  )
}
